import axios from 'axios'

export const createUsluga = (usluga) =>{
    return (dispatch, getState) =>{
        //async call to db dodavanje u bazu
        axios.post('http://localhost:8092/api/hotel/dodatneUsluge/', { additionalServiceName: usluga.nazivDodatneUslugeDodaj, additionalServicePrice: usluga.cenaDodatneUslugeDodaj, popust: usluga.popustDodaj, hotel_dodatneUsluge: usluga.hotelDodaj })
            .then(res => {
            console.log(res);
            //console.log(res.data);
      })
        dispatch({type: 'CREATE_USLUGA', usluga: usluga});
    }

}
